(2,	'b2ffa3b2aa96bcefd2ad8d29344b37b1',	'11',	'11',	'{\"username\":\"Mlplak\",\"token_project\":\"b2ffa3b2aa96bcefd2ad8d29344b37b1\",\"name\":\"eedd\",\"address\":\"de\",\"phone\":\"edded\",\"mueble\":\"dedeffrr\",\"total\":\"0\",\"senia\":\"0\",\"encargadoMed\":null,\"encargadoInst\":null,\"connectedCNC\":-1,\"fechaMedicion\":[],\"horaMedicion\":[],\"otrasFechaInstalacion\":[],\"otrasHoraInstalacion\":[],\"fechaInstalacion\":\"NaN\\/NaN\\/NaN\",\"horaInstalacion\":\"NaN:NaN\",\"comentarioInstalacion\":\"ferf\",\"comentario\":null,\"saldo\":null,\"pagos\":[{\"monto\":\"0\",\"descripcion\":\"0\",\"tipo\":null,\"date\":\"2022-01-17T18:01:45.874Z\",\"createdBy\":\"Mlplak\",\"isNew\":true}],\"items\":[{\"monto\":\"0\",\"descripcion\":\"0\",\"date\":\"2022-01-17T18:01:42.181Z\",\"createdBy\":\"Mlplak\"}],\"links\":[],\"seniaDescripcion\":null,\"totalDescripcion\":null,\"estadoProyecto\":\"Proyecto en Curso\"}',	'[{\"id\":11,\"usuario\":\"Mlplak\",\"nombre_completo\":\"ML plak\",\"correo_google\":\"ml_plak@gmail.com\",\"operacion\":\"Peticion\",\"comentario\":\"\"},{\"id\":29,\"usuario\":\"MLPLAKUsuario\",\"nombre_completo\":\"MLPLAKUsuario\",\"correo_google\":\"egafs@gmail.com\",\"operacion\":\"Revisado\",\"comentario\":\"\"},{\"id\":11,\"usuario\":\"Mlplak\",\"nombre_completo\":\"ML plak\",\"correo_google\":\"ml_plak@gmail.com\",\"operacion\":\"Confirmado\",\"comentario\":\"\"}]',	NULL,	'[{\"id\":1713,\"pregunta\":\"se revisaron los herrajes, bisagras correderas?\",\"respuesta\":\"1\",\"estatus\":\"activo\",\"completa\":false},{\"id\":1714,\"pregunta\":\"se revisaron los sentidos de las vetas?\",\"respuesta\":\"1\",\"estatus\":\"activo\",\"completa\":false},{\"id\":1725,\"pregunta\":\"se realizaron los ajustes de niveles, plomos y escuadras?\",\"respuesta\":\"1\",\"estatus\":\"activo\",\"completa\":false},{\"id\":1726,\"pregunta\":\"las aperturas de cajones o puertas se ven afectados por alg\\u00fan elemento del ambiente como estufa puerta, ventana cortina etc?\",\"respuesta\":\"1\",\"estatus\":\"activo\",\"completa\":false},{\"id\":1727,\"pregunta\":\"los cajones o bandejas salen por las puertas del mismo mueble?\",\"respuesta\":\"1\",\"estatus\":\"activo\",\"completa\":false},{\"id\":1728,\"pregunta\":\"Se controlo el tama\\u00f1o de las puertas y frentes de caj\\u00f3n? las l\\u00edneas est\\u00e9ticas estan correctas?\",\"respuesta\":\"1\",\"estatus\":\"activo\",\"completa\":false},{\"id\":1729,\"pregunta\":\"se revisaron todos los tapacantos? todos los listones tienen los respectivos tapacantos?\",\"respuesta\":\"1\",\"estatus\":\"activo\",\"completa\":false},{\"id\":1730,\"pregunta\":\"las m\\u00e9nsulas no se interponen con alguna piezas del mueble?\",\"respuesta\":\"1\",\"estatus\":\"activo\",\"completa\":false},{\"id\":1731,\"pregunta\":\"la mesada apoya en el mueble? hay banquina existentes?\",\"respuesta\":\"1\",\"estatus\":\"activo\",\"completa\":false},{\"id\":1732,\"pregunta\":\"Lleva alg\\u00fan accesorio?\",\"respuesta\":\"1\",\"estatus\":\"activo\",\"completa\":false},{\"id\":1733,\"pregunta\":\"se crearon todas las notas de acci\\u00f3n necesarias?\",\"respuesta\":\"1\",\"estatus\":\"activo\",\"completa\":false},{\"id\":1734,\"pregunta\":\"que sistema de apertura lleva y que linea? color\",\"respuesta\":null,\"estatus\":\"activo\",\"completa\":false},{\"id\":1735,\"pregunta\":\"Est\\u00e1n contempladas, caladas, las molduras y los z\\u00f3calos?\",\"respuesta\":\"1\",\"estatus\":\"activo\",\"completa\":false},{\"id\":1736,\"pregunta\":\"lleva otros calados? enchufes, llaves?\",\"respuesta\":\"1\",\"estatus\":\"activo\",\"completa\":false},{\"id\":1737,\"pregunta\":\"Como se ingresa al lugar? Ascensor- escalera- otro\",\"respuesta\":\"111\",\"estatus\":\"activo\",\"completa\":false},{\"id\":1739,\"pregunta\":\"se revisaron las profundidades de mesada y banquina?\",\"respuesta\":\"1\",\"estatus\":\"activo\",\"completa\":false},{\"id\":1740,\"pregunta\":\"Se realizo una revisi\\u00f3n general de las medidas globales