? color\",\"respuesta\":\"sistema con perfiles de aluminio - linea premium\",\"estatus\":\"activo\",\"completa\":false},{\"id\":1735,\"pregunta\":\"Est\\u00e1n contempladas, caladas, las molduras y los z\\u00f3calos?\",\"respuesta\":\"si\",\"estatus\":\"activo\",\"completa\":false},{\"id\":1736,\"pregunta\":\"lleva otros calados? enchufes, llaves?\",\"respuesta\":\"si hay dos calados de enchufes, en el modulo 9 y 15\",\"estatus\":\"activo\",\"completa\":false},{\"id\":1737,\"pregunta\":\"Como se ingresa al lugar? Ascensor- escalera- otro\",\"respuesta\":\"es una casa de planta baja\",\"estatus\":\"activo\",\"completa\":false},{\"id\":1739,\"pregunta\":\"se revisaron las profundidades de mesada y banquina?\",\"respuesta\":\"si\",\"estatus\":\"activo\",\"completa\":false},{\"id\":1740,\"pregunta\":\"Se realizo una revisi\\u00f3n general de las medidas globales?\",\"respuesta\":\"si\",\"estatus\":\"activo\",\"completa\":false},{\"id\":1741,\"pregunta\":\"Se puede armar en el Lugar? como se arma?\",\"respuesta\":\"se lleva armado\",\"estatus\":\"activo\",\"completa\":false},{\"id\":1742,\"pregunta\":\"Todos los \\\"artefactos\\\" como hornos, microondas, cavas, tv,  etc.  entran en los espacios destinados?\",\"respuesta\":\"si\",\"estatus\":\"activo\",\"completa\":false},{\"id\":1743,\"pregunta\":\"Se contemplo la BAcha y anafe en profundidad?  y en altura?\",\"respuesta\":\"si\",\"estatus\":\"activo\",\"completa\":false},{\"id\":1744,\"pregunta\":\"Se contemplaron los desag\\u00fces? las bocas de pillea o boca de inspecci\\u00f3n en el piso ?\",\"respuesta\":\"si\",\"estatus\":\"activo\",\"completa\":false},{\"id\":1745,\"pregunta\":\"Se contemplo la profundidad de la banquina? y el ancho? si el mueble o banquina va entre z\\u00f3calos se contemplo eso?\",\"respuesta\":\"si\",\"estatus\":\"activo\",\"completa\":false}]',	'[{\"id\":1717,\"pregunta\":\"Como es el ingreso al lugar? es en planta baja? o planta alta?  pasillo? casa? edificio? ascensor?\",\"respuesta\":\"casa. instalacion en planta baja\",\"estatus\":\"activo\",\"completa\":false},{\"id\":1718,\"pregunta\":\"Como es la habitaci\\u00f3n o lugar donde se va a armar?\",\"respuesta\":null,\"estatus\":\"activo\",\"completa\":false},{\"id\":1719,\"pregunta\":\"Se puede armar en el Lugar? como se arma?\",\"respuesta\":\"si\",\"estatus\":\"activo\",\"completa\":false},{\"id\":1720,\"pregunta\":\"Tiene todo terminado? piso, techo, paredes? revestimientos?  Listo para tomar las medidas?\",\"respuesta\":\"si\",\"estatus\":\"activo\",\"completa\":false},{\"id\":1771,\"pregunta\":\"se agregaron los detalles de la conversaci\\u00f3n a Notas? pedidos del cliente, plano inicial, fotos, etc,\",\"respuesta\":\"si\",\"estatus\":\"activo\",\"completa\":false},{\"id\":1811,\"pregunta\":\"observaciones sobre modelo\",\"respuesta\":null,\"estatus\":\"activo\",\"completa\":false},{\"id\":1812,\"pregunta\":\"observaciones sobre construcci\\u00f3n o acceso\",\"respuesta\":\"dejamos la medida de la alacena para que despues vaya el del cielorraso de yeso.\",\"estatus\":\"activo\",\"completa\":false},{\"id\":1813,\"pregunta\":\"observaciones sobre artefactos o accesorios\",\"respuesta\":null,\"estatus\":\"activo\",\"completa\":false},{\"id\":1817,\"pregunta\":\"de que material son las paredes de la zona donde va a instalarse el mueble? durlok? steel frame? wood frame? construcci\\u00f3n tradicional? otro?\",\"respuesta\":\"construccion tradicional\",\"estatus\":\"activo\",\"completa\":false}]',	'Confirmado',	'1',	'2022-07-12 13:11:18',	'2022-07-12 13:13:12');
