DROP TABLE IF EXISTS `view_historial_piezas`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_historial_piezas` AS select `hist`.`pieza_id` AS `pieza_id`,`hist`.`estado_id` AS `estado_id`,`hist`.`etapa_id` AS `etapa_id`,`hist`.`usuario_id` AS `usuario_id`,`hist`.`comentario` AS `comentario`,`hist`.`created_at` AS `created_at`,`piez`.`id_aux` AS `id_aux`,case `hist`.`etapa_id` when 1 then 'Cortes' when 2 then 'Tapacantos' when 3 then 'Prearmado' else 'UNDEFINED' end AS `etapa`,`us`.`usuario` AS `usuario`,`us`.`nombre_completo` AS `nombre_completo`,`piez`.`pieza` AS `pieza`,`est`.`estado` AS `estado` from (((`piezas_historiales` `hist` join `piezas` `piez` on(`piez`.`id` = `hist`.`pieza_id`)) join `estados` `est` on(`est`.`id` = `hist`.`estado_id`)) join `usuarios` `us` on(`us`.`id` = `hist`.`usuario_id`));

DROP TABLE IF EXISTS `view_historial_taller`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `view_historial_taller` AS select `hist`.`id` AS `id`,`hist`.`estado_id` AS `estado_id`,`hist`.`etapa_id` AS `etapa_id`,`hist`.`usuario_id` AS `usuario_id`,`hist`.`campo_id` AS `campo_id`,`hist`.`desc_campo` AS `desc_campo`,`hist`.`comentario` AS `comentario`,`hist`.`created_at` AS `created_at`,`us`.`usuario` AS `usuario`,`us`.`nombre_completo` AS `nombre_completo`,`est`.`estado` AS `estado`,case `hist`.`etapa_id` when 2 then 'Stock' when 6 then 'Nota de acción' when 7 then 'Cajones' when 8 then 'Módulos' when 9 then 'Control' else 'UNDEFINED' end AS `etapa` from ((`taller_historiales` `hist` join `estados` `est` on(`est`.`id` = `hist`.`estado_id`)) join `usuarios` `us` on(`us`.`id` = `hist`.`usuario_id`));

DROP TABLE IF EXISTS `view_notif_us_activas`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_notif_us_activas` AS select `n`.`id` AS `id`,`n`.`sector_id` AS `sector_id`,`n`.`periodo_repeticion_id` AS `periodo_repeticion_id`,`n`.`titulo` AS `titulo`,`n`.`contenido` AS `contenido`,`n`.`fecha_inicio` AS `fecha_inicio`,`n`.`fecha_fin` AS `fecha_fin`,`n`.`activo` AS `activo`,`nUs`.`usuario_id` AS `usuario_id`,`n`.`num_repeticion` AS `num_repeticion`,`nUs`.`num_vista` AS `num_vista`,`nUs`.`vista` AS `vista` from (`mk_notificaciones` `n` left join `mk_notificaciones_usuarios` `nUs` on(`nUs`.`notificacion_id` = `n`.`id`)) where curdate() between `n`.`fecha_inicio` and `n`.`fecha_fin` and `n`.`num_repeticion` >= `nUs`.`num_vista`;

